import React from 'react'
import './Dropdown.css'
import { ComboBoxComponent } from '@syncfusion/ej2-react-dropdowns';

function Dropdown(label, data) {
  const divStyle = {
    margin: 100,
    width: 250
  }
  return (
    <div className="dropdown__container" style={divStyle}>
      <ComboBoxComponent placeholder={label} dataSource={data}></ComboBoxComponent>
    </div>
  )
}

export default Dropdown
